#### Params Check

```javascript
//npm i -S params-check --production
const ParamsCheck = require('params-check')
//optional container to catch the error throw;
const funcContainer = ParamsCheck.funcContainer;
// test adapter to check number of params send to function
const adapter = (params, schema) => {
  if(params.length == schema.numberOfParams) {
    return {error:null}
  } 
  return {error:'missing params!'}
}; 
// create instance with adapter for validation
const paramsCheck = new ParamsCheck(adapter); 
// test function
const testFunc = (a, b, c) => a + b + c; 
const validationRules = {
  numberOfParams:3
}
// composition 
const testedFunc = paramsCheck.withValidation(testFunc.name, validationRules, testFunc); 

test('to throw', () => { 
  let isThrow = false;
  //will throw error missing param, got 2 instead of 3;
  funcContainer(()=>testedFunc(1, 2),(error)=> {console.log(error); isThrow = true;}); 
  expect(isThrow).toBe(true);
});

test('to pass', () => {
  expect(testedFunc(1, 2, 3)).toBe(6);
});
```

# nextjs-middleware
Express middleware for Nextjs.

## Usage
```
npm i nextjs-middleware -S
```

server.js
```
const express = require('express')
const NextMiddleware = require('./index');
const main = async () => {
    try {
        const debug = true;
        const nextMiddleware = await NextMiddleware(debug); // make sure next prepare finish.
        const server = express();
        server.use(nextMiddleware);

        server.get('/example', (req, res) => {
            if (!req.parsedUrl.query.page) {
                return res.redirect('/example?page=2');
            }
            return res.view.render({req,res,path:'/examplePage',query:req.parsedUrl.query});
        });

        server.get('/example2', (req, res) => {

            return res.view.render({path:'/examplePage'}); 
        });

        server.get('*', (req, res) => {

            return res.view.handle({}); //pass an empty object {} for auto filling
        });

        server.listen(3000, (err) => {
            if (err) 
                throw err
            console.log('> Ready on http://localhost:3000');
        })
    } catch (error) {
        console.log({error})
    }
}

main();
```

# apigateway-export-tool

## Usage CLI

```
Usage: apigateway-export-tool [command]

Options:
  -V, --version     output the version number
  -h, --help        output usage information

Commands:
  docs [options]    Download docs file for a given restApiId.
  list [options]    List all restApis.
  stages [options]  Get stages for a given restApiId.
  sdk [options]     Download sdk for a given restApiId.
```

```
npx apigateway-export-tool list
npx apigateway-export-tool docs -h
npx apigateway-export-tool docs -i 123123 -stageName prod
```

## Usage Nodejs

```
// checkout examples https://github.com/niradler/apigateway-export-tool/blob/master/test.js
